import React from 'react';

const CurrResult = () => {
    return (
        <div className="flex w-5/6">
            <div className="grid h-60 flex-grow card bg-gray-100 rounded place-items-center m-auto ml-6">
                <select id="currency-result" className="select outline outline-1 outline-slate-600 w-72 max-w-sm">
                    <option value="21000">Bitcoin(BTC)</option>
                    <option value="1500">Ethereum (ETH)</option>
                    <option value="400">Tether (USDT)</option>
                    <option value="500">Dogecoin (DOGE)</option>
                </select>
            </div>

            <div className="grid h-60 flex-grow card bg-gray-100 rounded place-items-center ">
                <select className="select outline outline-1 outline-slate-600 w-72 max-w-xs">
                    <option value="21000">United States Dollar "$" (USD)</option>
                    <option value="400">Argentine Peso "ARS" (ARS)</option>
                    <option value="500">Belarusian Ruble "Br" (BYN)</option>
                </select>
            </div>
        </div>


    );
};

export default CurrResult;
